import React from 'react'

const Counter = () => {
  const [init, setCount] = React.Use
  return (
    <div>
      <h2>0</h2>
      <button type="button" class="btn btn-warning " onClick={()=>{ setCount(init+1)}}>+</button>
      <button type="button" class="btn btn-danger">-</button>
    </div>
  )
}

export default Counter
